selector_to_html = {"a[href=\"commands/pwd.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">pwd</span></code> - print working directory<a class=\"headerlink\" href=\"#pwd-print-working-directory\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"commands/module.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">module</span></code> - load software on slurm<a class=\"headerlink\" href=\"#module-load-software-on-slurm\" title=\"Permalink to this heading\">#</a></h1><p>List available programs</p><p>``bash\nmodule av</p>", "a[href=\"commands/awk.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">awk</span></code> - manipulate text<a class=\"headerlink\" href=\"#awk-manipulate-text\" title=\"Permalink to this heading\">#</a></h1><p>Treating a text file, were each space is a column, you can print the columns with:</p>", "a[href=\"#term-rm\"]": "<dt id=\"term-rm\"><a class=\"reference internal\" href=\"commands/rm.html\"><span class=\"doc std std-doc\">rm</span></a></dt><dd><p>delete files</p></dd>", "a[href=\"commands/sbatch.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">sbatch</span></code> - Submit job to Slurm<a class=\"headerlink\" href=\"#sbatch-submit-job-to-slurm\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"#term-head\"]": "<dt id=\"term-head\"><a class=\"reference internal\" href=\"commands/head.html\"><span class=\"doc std std-doc\">head</span></a></dt><dd><p>read from top of file to standard output</p></dd>", "a[href=\"#list-of-commands\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">List of Commands<a class=\"headerlink\" href=\"#list-of-commands\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"#term-sbatch\"]": "<dt id=\"term-sbatch\"><a class=\"reference internal\" href=\"commands/sbatch.html\"><span class=\"doc std std-doc\">sbatch</span></a></dt><dd><p>Submit job to Slurm</p></dd>", "a[href=\"commands/tail.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">tail</span></code> - read from bottom of file<a class=\"headerlink\" href=\"#tail-read-from-bottom-of-file\" title=\"Permalink to this heading\">#</a></h1><p>Print X-number of lines of <code class=\"docutils literal notranslate\"><span class=\"pre\">file.txt</span></code>.</p>", "a[href=\"#term-pwd\"]": "<dt id=\"term-pwd\"><a class=\"reference internal\" href=\"commands/pwd.html\"><span class=\"doc std std-doc\">pwd</span></a></dt><dd><p>print working directory</p></dd>", "a[href=\"#term-sed\"]": "<dt id=\"term-sed\"><a class=\"reference internal\" href=\"commands/sed.html\"><span class=\"doc std std-doc\">sed</span></a></dt><dd><p>tranform/replace text!</p></dd>", "a[href=\"commands/rm.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">rm</span></code> - delete files<a class=\"headerlink\" href=\"#rm-delete-files\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"commands/scp.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">scp</span></code> - copy files/folders over ssh<a class=\"headerlink\" href=\"#scp-copy-files-folders-over-ssh\" title=\"Permalink to this heading\">#</a></h1><p>Using the command, <code class=\"docutils literal notranslate\"><span class=\"pre\">scp</span></code>, is helpful for copying single files or folders that aren\u2019t too large in size. The general notation is similar to <code class=\"docutils literal notranslate\"><span class=\"pre\">rsync</span></code>:</p>", "a[href=\"commands/ssh.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">ssh</span></code> - secure shell protocol<a class=\"headerlink\" href=\"#ssh-secure-shell-protocol\" title=\"Permalink to this heading\">#</a></h1><p>Remotely access a computer</p>", "a[href=\"commands/sinfo.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">sinfo</span></code> - View information about Slurm nodes and partitions.<a class=\"headerlink\" href=\"#sinfo-view-information-about-slurm-nodes-and-partitions\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"#term-grep\"]": "<dt id=\"term-grep\"><a class=\"reference internal\" href=\"commands/grep.html\"><span class=\"doc std std-doc\">grep</span></a></dt><dd><p>search for pattern in file or folders</p></dd>", "a[href=\"#term-ssh-keygen\"]": "<dt id=\"term-ssh-keygen\"><a class=\"reference internal\" href=\"commands/ssh-keygen.html\"><span class=\"doc std std-doc\">ssh-keygen</span></a></dt><dd><p>keygen`</p></dd>", "a[href=\"#term-tail\"]": "<dt id=\"term-tail\"><a class=\"reference internal\" href=\"commands/tail.html\"><span class=\"doc std std-doc\">tail</span></a></dt><dd><p>read from bottom of file</p></dd>", "a[href=\"commands/cat.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">cat</span></code> - print input to standard output<a class=\"headerlink\" href=\"#cat-print-input-to-standard-output\" title=\"Permalink to this heading\">#</a></h1><p>We can also read the file using <code class=\"docutils literal notranslate\"><span class=\"pre\">cat</span></code>:</p>", "a[href=\"commands/seq.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">seq</span></code> - sequence of numbers<a class=\"headerlink\" href=\"#seq-sequence-of-numbers\" title=\"Permalink to this heading\">#</a></h1><p>Default increment of 1.</p>", "a[href=\"#term-ssh\"]": "<dt id=\"term-ssh\"><a class=\"reference internal\" href=\"commands/ssh.html\"><span class=\"doc std std-doc\">ssh</span></a></dt><dd><p>secure shell protocol</p></dd>", "a[href=\"#term-cp\"]": "<dt id=\"term-cp\"><a class=\"reference internal\" href=\"commands/cp.html\"><span class=\"doc std std-doc\">cp</span></a></dt><dd><p>copy files or folders</p></dd>", "a[href=\"commands/trap.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">trap</span></code> - signalled execution<a class=\"headerlink\" href=\"#trap-signalled-execution\" title=\"Permalink to this heading\">#</a></h1><p>The <code class=\"docutils literal notranslate\"><span class=\"pre\">trap</span></code> command allows you to execute a command whenever your script receives a signal. Here, <code class=\"docutils literal notranslate\"><span class=\"pre\">trap</span></code> will execute <code class=\"docutils literal notranslate\"><span class=\"pre\">rm</span></code> if it receives any of the three listed signals.</p>", "a[href=\"commands/tar.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">tar</span></code> - compress/uncompress files<a class=\"headerlink\" href=\"#tar-compress-uncompress-files\" title=\"Permalink to this heading\">#</a></h1><p><code class=\"docutils literal notranslate\"><span class=\"pre\">tar</span></code> stands for tape archive.</p><p>We can use the <code class=\"docutils literal notranslate\"><span class=\"pre\">tar</span></code> command to create, compressed, or uncompressed Archive files, and also maintain/modify them.</p>", "a[href=\"#term-cd\"]": "<dt id=\"term-cd\"><a class=\"reference internal\" href=\"commands/cd.html\"><span class=\"doc std std-doc\">cd</span></a></dt><dd><p>change directories</p></dd>", "a[href=\"#term-rsync\"]": "<dt id=\"term-rsync\"><a class=\"reference internal\" href=\"commands/rsync.html\"><span class=\"doc std std-doc\">rsync</span></a></dt><dd><p>sync files/folders</p></dd>", "a[href=\"#term-cat\"]": "<dt id=\"term-cat\"><a class=\"reference internal\" href=\"commands/cat.html\"><span class=\"doc std std-doc\">cat</span></a></dt><dd><p>print input to standard output</p></dd>", "a[href=\"commands/mv.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">mv</span></code> - move files/folders from one place to another.<a class=\"headerlink\" href=\"#mv-move-files-folders-from-one-place-to-another\" title=\"Permalink to this heading\">#</a></h1><p><code class=\"docutils literal notranslate\"><span class=\"pre\">mv</span></code> is similar to <code class=\"docutils literal notranslate\"><span class=\"pre\">cp</span></code>, but it deletes the source.\n<code class=\"docutils literal notranslate\"><span class=\"pre\">mv</span></code> is also useful for renaming files!</p>", "a[href=\"#term-scancel\"]": "<dt id=\"term-scancel\"><a class=\"reference internal\" href=\"commands/scancel.html\"><span class=\"doc std std-doc\">scancel</span></a></dt><dd><p>Cancel Slurm Jobs</p></dd>", "a[href=\"#term-scp\"]": "<dt id=\"term-scp\"><a class=\"reference internal\" href=\"commands/scp.html\"><span class=\"doc std std-doc\">scp</span></a></dt><dd><p>copy files/folders over ssh</p></dd>", "a[href=\"#term-help\"]": "<dt id=\"term-help\"><a class=\"reference internal\" href=\"commands/help.html\"><span class=\"doc std std-doc\">help</span></a></dt><dd><p>read documentation</p></dd>", "a[href=\"commands/cd.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">cd</span></code> - change directories<a class=\"headerlink\" href=\"#cd-change-directories\" title=\"Permalink to this heading\">#</a></h1><p>Since bash works in the context of a current directory, you might want to run your command in some other directory. We have cd for changing location:</p><p>Change to home directory</p>", "a[href=\"commands/grep.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">grep</span></code> - search for pattern in file or folders<a class=\"headerlink\" href=\"#grep-search-for-pattern-in-file-or-folders\" title=\"Permalink to this heading\">#</a></h1><p>Example</p>", "a[href=\"#term-ls\"]": "<dt id=\"term-ls\"><a class=\"reference internal\" href=\"commands/ls.html\"><span class=\"doc std std-doc\">ls</span></a></dt><dd><p>list information about files/folders</p></dd>", "a[href=\"#term-mv\"]": "<dt id=\"term-mv\"><a class=\"reference internal\" href=\"commands/mv.html\"><span class=\"doc std std-doc\">mv</span></a></dt><dd><p>move files/folders from one place to another.</p></dd>", "a[href=\"#term-module\"]": "<dt id=\"term-module\"><a class=\"reference internal\" href=\"commands/module.html\"><span class=\"doc std std-doc\">module</span></a></dt><dd><p>load software on slurm</p></dd>", "a[href=\"commands/chsh.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">chsh - change shell<a class=\"headerlink\" href=\"#chsh-change-shell\" title=\"Permalink to this heading\">#</a></h1><p>If you don\u2019t know which shell you\u2019re using, type the following command in your terminal:</p>", "a[href=\"#term-awk\"]": "<dt id=\"term-awk\"><a class=\"reference internal\" href=\"commands/awk.html\"><span class=\"doc std std-doc\">awk</span></a></dt><dd><p>manipulate text</p></dd>", "a[href=\"commands/sed.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">sed</span></code> - tranform/replace text!<a class=\"headerlink\" href=\"#sed-tranform-replace-text\" title=\"Permalink to this heading\">#</a></h1><p>We can replace some text, INPUT, with another text, OUTPUT, in a file with <code class=\"docutils literal notranslate\"><span class=\"pre\">sed</span></code>. The notation is:</p>", "a[href=\"commands/less.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">less</span></code> - view files<a class=\"headerlink\" href=\"#less-view-files\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"#term-tar\"]": "<dt id=\"term-tar\"><a class=\"reference internal\" href=\"commands/tar.html\"><span class=\"doc std std-doc\">tar</span></a></dt><dd><p>compress/uncompress files</p></dd>", "a[href=\"commands/ls.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">ls</span></code> - list information about files/folders<a class=\"headerlink\" href=\"#ls-list-information-about-files-folders\" title=\"Permalink to this heading\">#</a></h1><p>The default is to list the files in the current directory. Adding options can change how the list is organized.</p>", "a[href=\"commands/scancel.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">scancel</span></code> - Cancel Slurm Jobs<a class=\"headerlink\" href=\"#scancel-cancel-slurm-jobs\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"commands/mkdir.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">mkdir</span></code> - make new directories.<a class=\"headerlink\" href=\"#mkdir-make-new-directories\" title=\"Permalink to this heading\">#</a></h1><p>The <code class=\"docutils literal notranslate\"><span class=\"pre\">-p</span></code> flag causes new intermediate directories to be created as necessary.</p>", "a[href=\"commands/setfacl.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">setfacl</span></code> - change file/folder permissions<a class=\"headerlink\" href=\"#setfacl-change-file-folder-permissions\" title=\"Permalink to this heading\">#</a></h1><p>Give specific user permission to read/write/execute a folder.</p><p><code class=\"docutils literal notranslate\"><span class=\"pre\">setfacl</span></code> is short for set File ACL (Access Control List). This sets permissions for specific users, without changing the owndership of the directory.</p>", "a[href=\"#term-trap\"]": "<dt id=\"term-trap\"><a class=\"reference internal\" href=\"commands/trap.html\"><span class=\"doc std std-doc\">trap</span></a></dt><dd><p>signalled execution</p></dd>", "a[href=\"#term-seq\"]": "<dt id=\"term-seq\"><a class=\"reference internal\" href=\"commands/seq.html\"><span class=\"doc std std-doc\">seq</span></a></dt><dd><p>sequence of numbers</p></dd>", "a[href=\"commands/sort.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">sort</span></code> - sorts lines<a class=\"headerlink\" href=\"#sort-sorts-lines\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"commands/cp.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">cp</span></code> - copy files or folders<a class=\"headerlink\" href=\"#cp-copy-files-or-folders\" title=\"Permalink to this heading\">#</a></h1><p>To copy file1 to file2 (new name):</p>", "a[href=\"commands/head.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">head</span></code> - read from top of file to standard output<a class=\"headerlink\" href=\"#head-read-from-top-of-file-to-standard-output\" title=\"Permalink to this heading\">#</a></h1><p>Print X-number of lines of <code class=\"docutils literal notranslate\"><span class=\"pre\">file.txt</span></code>.</p>", "a[href=\"#term-setfacl\"]": "<dt id=\"term-setfacl\"><a class=\"reference internal\" href=\"commands/setfacl.html\"><span class=\"doc std std-doc\">setfacl</span></a></dt><dd><p>change file/folder permissions</p></dd>", "a[href=\"#term-man\"]": "<dt id=\"term-man\"><a class=\"reference internal\" href=\"commands/man.html\"><span class=\"doc std std-doc\">man</span></a></dt><dd><p>documentation for various functions</p></dd>", "a[href=\"commands/help.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">help</span></code> - read documentation<a class=\"headerlink\" href=\"#help-read-documentation\" title=\"Permalink to this heading\">#</a></h1><p>Read Bash shell built-ins documentation with the bash <code class=\"docutils literal notranslate\"><span class=\"pre\">help</span></code> built-in:</p>", "a[href=\"commands/ssh-keygen.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">ssh-keygen</span></code> - Make SSH key<a class=\"headerlink\" href=\"#ssh-keygen-make-ssh-key\" title=\"Permalink to this heading\">#</a></h1><p><code class=\"docutils literal notranslate\"><span class=\"pre\">ssh-keygen</span></code> creates an RSA key pair and stores the public key in a public key file named <code class=\"docutils literal notranslate\"><span class=\"pre\">.ssh/id_rsa.pub</span></code> and a private key file named <code class=\"docutils literal notranslate\"><span class=\"pre\">.ssh/id_rsa</span></code>.</p><p>To make a key, you can type:</p>", "a[href=\"#term-mkdir\"]": "<dt id=\"term-mkdir\"><a class=\"reference internal\" href=\"commands/mkdir.html\"><span class=\"doc std std-doc\">mkdir</span></a></dt><dd><p>make new directories.</p></dd>", "a[href=\"#term-sinfo\"]": "<dt id=\"term-sinfo\"><a class=\"reference internal\" href=\"commands/sinfo.html\"><span class=\"doc std std-doc\">sinfo</span></a></dt><dd><p>View information about Slurm nodes and partitions.</p></dd>", "a[href=\"commands/rsync.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">rsync</span></code> - sync files/folders<a class=\"headerlink\" href=\"#rsync-sync-files-folders\" title=\"Permalink to this heading\">#</a></h1><p>Since I typically use <code class=\"docutils literal notranslate\"><span class=\"pre\">rsync</span></code> to transfer folders, I will not cover using this command for tranfering files. You can use <code class=\"docutils literal notranslate\"><span class=\"pre\">scp</span></code> for that. T</p><p>he notation for <code class=\"docutils literal notranslate\"><span class=\"pre\">rsync</span></code> looks like:</p>", "a[href=\"#term-chsh\"]": "<dt id=\"term-chsh\"><a class=\"reference internal\" href=\"commands/chsh.html\"><span class=\"doc std std-doc\">chsh</span></a></dt><dd><p>change shell</p></dd>", "a[href=\"commands/man.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">man</span></code> - documentation for various functions<a class=\"headerlink\" href=\"#man-documentation-for-various-functions\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"#term-sort\"]": "<dt id=\"term-sort\"><a class=\"reference internal\" href=\"commands/sort.html\"><span class=\"doc std std-doc\">sort</span></a></dt><dd><p>sorts lines</p></dd>", "a[href=\"#term-less\"]": "<dt id=\"term-less\"><a class=\"reference internal\" href=\"commands/less.html\"><span class=\"doc std std-doc\">less</span></a></dt><dd><p>view files</p></dd>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
